import { PropTypes } from "prop-types";
import { TodoItem } from "./TodoItem";


export const TodoList = ( {list} ) => {

    return (
        <ul className="list-group">
            {
                list.map( toDo => (  
                    <TodoItem id={ toDo.id } desc={ toDo.desc } />
                ) )
            }
        </ul>
    )
}

TodoList.propType = {
    list: PropTypes.string,
}
